 import axios from 'axios'
 function Index(){
    return <span>Index</span>
 }
 //服务端和客户端都会执行
 Index.getInitialProps=async ()=>{
   const result=await axios
   .get('/github/search/repositories?q=react')
   .then(resp=>console.log(resp))

   return {
     data:result.data
   }
 }
export default Index
